import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Dashboard from "./pages/Dashboard";
import Products from "./pages/Products";
import Orders from "./pages/Orders";

export default function App() {
  return (
    <Router>
      <div className="flex">
        {/* Sidebar */}
        <aside className="w-64 bg-gray-800 text-white min-h-screen p-6 space-y-6">
          <h1 className="text-2xl font-bold">Shopify Analytics</h1>
          <nav className="space-y-3">
            <Link to="/" className="block hover:text-gray-300">Dashboard</Link>
            <Link to="/products" className="block hover:text-gray-300">Products</Link>
            <Link to="/orders" className="block hover:text-gray-300">Orders</Link>
          </nav>
        </aside>

        {/* Main Content */}
        <main className="flex-1 bg-gray-50">
          <Routes>
            <Route path="/" element={<Dashboard />} />
            <Route path="/products" element={<Products />} />
            <Route path="/orders" element={<Orders />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}
